import React from 'react';
import { Helmet } from 'react-helmet';
import { Button, Container, Typography, Box, List, ListItem, ListItemText } from '@mui/material';
import Services from './Services';
import About from './About';
import Testimonials from './Testimonials';
import Contact from './Contact';
import SocialMedia from './SocialMedia';
import Blog from './Blog';

const Team = () => (
  <Box mt={2} mb={2}>
    <Typography variant="h4" component="h2" gutterBottom>
      Meet the Team
    </Typography>
    <List>
      <ListItem>
        <ListItemText
          primary="CEO - Navdeep Singh"
          secondary="Navdeep has led TechBitz since its inception in 2010, driving our vision for a connected and digital world."
        />
      </ListItem>
      <ListItem>
        <ListItemText
          primary="CMO - [Your Name]"
          secondary="[Add bio here]"
        />
      </ListItem>
    </List>
  </Box>
);

const Home = () => {
  return (
    <Container>
      <Helmet>
        {/* Helmet content remains unchanged */}
      </Helmet>
      {/* Welcome and intro sections remain unchanged */}
      <Services />
      <About />
      <Team />
      <Testimonials />
      <Box mt={2} mb={2}>
        {/* Request a quote section remains unchanged */}
      </Box>
      <Contact />
      <SocialMedia />
      <Blog />
    </Container>
  );
}

export default Home;
